object = {}
function object:new(o)
    o = o or {}
    setmetatable(o, self)
    self.__index = self
    return o
end

videoWindow = object:new()

videoWindow.videoData = nil

videoWindow.responseData = nil

videoWindow.tagBtnarr = nil

videoWindow.figureImagearr = nil
videoWindow.figureTitlearr = nil
videoWindow.figureNamearr = nil

videoWindow.miniAppId = ""

local isShowHeadView = true

local screenW, screenH = Native:getVideoSize(2)

local scale = math.min(screenW, screenH) / 375
local fontScale = scale < 0.8 and 0.8 or (scale > 1.5 and 1.5 or scale)

local entranceTitle = { "TA的同款", "为TA打榜", "TA的角色" }

local identicalImage = ""

local refuelImage = ""

local roleImage = ""

local heaberbackimage = ""

local imagearr = { identicalImage, refuelImage, roleImage }

local function getScale()
    local screenW, screenH = Native:getVideoSize(2)
    return math.min(screenW, screenH) / 375
end

-- 设置label属性
local function labelSetProperty(superView, label, fontSize, textColor, text)

    label:fontSize(fontSize)
    label:textColor(textColor)
    label:text(text)
    superView:addView(label)
end

-- 适配大屏
local function adaptiveScreenMonitors(int)

    if Native:isPortraitScreen() == false then
        return int * getScale()
    end
end

local function judgeString(str)

    if str ~= nil and #str > 0 then
        return str
    else
        return " - "
    end
end

local function setSidebarHeadViewData(data)

    if isShowHeadView == true then
        videoWindow.sidebarHeadView:hidden(false)
    else
        videoWindow.sidebarHeadView:hidden(true)
    end
    videoWindow.sidebarHeadImage:image(data.coverPhotoUrl)
    videoWindow.sidebarNameLabel:text(data.cnName)
    videoWindow.anotherNameLabel:text("别名: " .. judgeString(data.aliasName))
    videoWindow.fansNameLabel:text("粉丝昵称: " .. judgeString(data.fansName))
end

local function addsidebarHeadView()
    videoWindow.sidebarHeadView = View()
    videoWindow.sidebarHeadView:alpha(0)
    videoWindow.sidebarHeadView:frame(0, 0, videoWindow.sidebarView:width(), 90 * getScale())
    videoWindow.sidebarHeadView:backgroundColor(0x2E323A)
    videoWindow.sidebarView:addView(videoWindow.sidebarHeadView)

    videoWindow.sidebarHeadImage = Image()
    videoWindow.sidebarHeadImage:frame(12 * getScale(), 12 * getScale(), 70 * getScale(), 70 * getScale())
    videoWindow.sidebarHeadImage:cornerRadius(6)
    videoWindow.sidebarHeadView:addView(videoWindow.sidebarHeadImage)

    videoWindow.sidebarNameLabel = Label()
    labelSetProperty(videoWindow.sidebarHeadView, videoWindow.sidebarNameLabel, adaptiveScreenMonitors(14), 0xE6E6E6, "")
    if System.ios() then
        videoWindow.sidebarNameLabel:frame(videoWindow.sidebarHeadImage:x() + videoWindow.sidebarHeadImage:width() + 10 * getScale(), videoWindow.sidebarHeadImage:y() + 10, 90 * getScale(), 15 * getScale())

        videoWindow.sidebarNameLabel:font("Helvetica-Bold", 14)
    else
        videoWindow.sidebarNameLabel:frame(videoWindow.sidebarHeadImage:x() + videoWindow.sidebarHeadImage:width() + 10 * getScale(), videoWindow.sidebarHeadImage:y() + 10, 90 * getScale(), 17 * getScale())
        videoWindow.sidebarNameLabel:textBold()

    end

    videoWindow.anotherNameLabel = Label()
    videoWindow.anotherNameLabel:frame(videoWindow.sidebarNameLabel:x(), videoWindow.sidebarNameLabel:y() + videoWindow.sidebarNameLabel:height() + 6 * getScale(), 100 * getScale(), 15 * getScale())
    labelSetProperty(videoWindow.sidebarHeadView, videoWindow.anotherNameLabel, adaptiveScreenMonitors(10), 0xB3B3B3, "")

    videoWindow.fansNameLabel = Label()
    videoWindow.fansNameLabel:frame(videoWindow.anotherNameLabel:x(), videoWindow.anotherNameLabel:y() + videoWindow.anotherNameLabel:height() + 3 * getScale(), 115 * getScale(), 15 * getScale())
    labelSetProperty(videoWindow.sidebarHeadView, videoWindow.fansNameLabel, adaptiveScreenMonitors(10), 0xB3B3B3, "")

