local function addSidebarViewNetWork(miniAppId)

    local infoDic = {}
    infoDic["originMiniAppId"] = videoWindow.miniAppId
    infoDic["miniAppId"] = miniAppId
    if (Native.commonTrack) then
        Native:commonTrack(1, infoDic)
    end

    local dic = {}
    dic["labelId"] = videoWindow.videoData.labelId
    Native:sendAction(Native:base64Encode("LuaView://applets?appletId=" .. miniAppId .. "&type=1&appType=2"), dic)


end


